  static List<Record> getSearchResults(String key){
    var document = xml.parse(citylistXml);
    List<Record> titles = document.findAllElements("RECORD")
    .map<Record>((node) => Record(fid: node.findElements("Fid").first.text, 
    name: node.findElements("name").first.text,
    nameEn: node.findElements("name_en").first.text,
    namePy: node.findElements("name_py").first.text,
    fProvinceCn: node.findElements("Fprovince_cn").first.text,
    fWeathercn: node.findElements("Fweathercn").first.text),
    )
    .toList();

    for(var item in titles){
      if(item.name.contains(key)){
        nodes.add(item);
      }
    }
    return nodes;
  }


